import styles from "../assets/styles/homepage.css"
import useSWR from 'swr';

function fetcher(url){
    return fetch(url).then(r =>r.json());
}

const Index = () => {
    const { data, error } = useSWR("../pages/api/getProfileRoles", fetcher);

    console.log(data);

    return (
            <main className="main">
                <div>
                    <h1>Raghav Sharma</h1>
                    <div>I am </div>
                </div>
            </main>);
}

export default Index;
